import { BrowserRouter as Router, Link, Routes, Route} from "react-router-dom";

function Header() {
    return (
      <Router>
        <Link to="/">charlie</Link>
        <Router></Router>
      <div>
        <h1>charlie</h1>
      </div>
      </Router>
    );
  }

  export default Header;
